://127.0.0.1:45971 &lt;/li&gt;\n          &lt;li&gt; Workers: 10 &lt;/li&gt;\n          &lt;li&gt; Threads: 10 &lt;/li&gt;\n          &lt;li&gt; Memory: 503.79 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.04.1+24.g07d5ad0a &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2021.04.1+20.gd6f5609a &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\ndef main(client: Client, filename_suffix: str = \"\"):\n    df = dask.datasets.timeseries(\n        start=\"2000-01-01\",\n        end=\"2000-01-31\",\n        # end=\"2000-12-31\",\n        partition_freq=\"1h\",\n        freq=\"60s\",\n    )\n    df = df.persist()\n    wait(df)\n    iterations = 10\n\n    with performance_report(filename=f\"{today}-simple-scheduler{filename_suffix}.html\"):\n        simple = []\n        # print('start simple: ', flush=True)\n        for i in range(iterations):\n            start = time.perf_counter()\n            z = df.x + 1 + 2 - df.y\n            z.sum().compute()\n            stop = time.perf_counter()\n            simple.append(stop - start)\n        simple = np.array(simple)\n\n    df2 = None\n    with performance_report(filename=f\"{today}-shuffle-scheduler{filename_suffix}.html\"):\n        shuffle_t = []\n        # print('start shuffle: ', flush=True)\n        for i in range(iterations):\n            client.cancel(df2)\n            start = time.perf_counter()\n            # shuffle(df, \"id\", shuffle=\"tasks\")\n            df2 = df.set_index(\"id\").persist()\n            wait(df2)\n            stop = time.perf_counter()\n            shuffle_t.append(stop - start)\n        shuffle_t = np.array(shuffle_t)\n\n    with performance_report(filename=f\"{today}-rand-access-scheduler{filename_suffix}.html\"):\n        rand_access = []\n        for i in range(iterations):\n            start = time.time()\n            df2.head()\n            stop = time.time()\n            rand_access.append(stop - start)\n        rand_access = np.array(rand_access)\n    data = dsa.random.random((10000, 1000000), chunks=(1, 1000000))\n    da = xr.DataArray(data, dims=['time', 'x'],\n                      coords={'day': ('time', np.arange(10000) % 100)})\n    clim = da.groupby('day').mean(dim='time')\n    anom = da.groupby('day') - clim\n    anom_mean = anom.mean(dim='time')\n    with performance_report(filename=f\"{today}-anom-mean-scheduler{filename_suffix}.html\"):\n        anom_mean_t = []\n        for i in range(iterations):\n            start = time.time()\n            anom_mean.compute()\n            stop = time.time()\n            anom_mean_t.append(stop-start)\n\n        anom_mean_t = np.array(anom_mean_t)\n\n    return dict(simple=simple, shuffle=shuffle_t, rand_access=rand_access,\n            anom_mean=anom_mean_t)\n\n        &lt;/pre&gt;\n        "},"id":"1209","type":"Div"},{"attributes":{},"id":"1039","type":"DataRange1d"},{"attributes":{"bottom":{"field":"bottom"},"fill_color":{"field":"color"},"left":{"field":"left"},"line_width":{"value":2},"right":{"field":"right"},"top":{"field":"top"}},"id":"1101","type":"Quad"},{"attributes":{},"id":"1043","type":"LinearScale"},{"attributes":{"overlay":{"id":"1059"}},"id":"1056","type":"BoxZoomTool"},{"attributes":{"bottom":{"field":"bottom"},"fill_color":{"field":"color"},"left":{"field":"left"},"line_width":{"value":2},"right":{"field":"right"},"top":{"field":"top"}},"id":"1066","type":"Quad"},{"attributes":{},"id":"1258","type":"AllLabels"},{"attributes":{"bottom_units":"screen","fill_alpha":0.5,"fill_color":"lightgrey","left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"1059","type":"BoxAnnotation"},{"attributes":{"bottom_units":"screen","fill_alpha":0.5,"fill_color":"lightgrey","left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","s
